removing code to try to center the titles

/* Internet Explorer 10 */
  display:-ms-flexbox;
  -ms-flex-pack:center;
  -ms-flex-align:center;
  /* Firefox */
  display:-moz-box;
  -moz-box-pack:center;
  -moz-box-align:center;
  /* Safari, Opera, and Chrome */
  display:-webkit-box;
  -webkit-box-pack:center;
  -webkit-box-align:center;
  display: box;
  box-pack: center;
  box-align: center

正确支持 User login 里面的大小写字母，不再全部转成小写。
之前转小写是错误的配置了 Devise 的 case_insensitive_keys
修正某些字符的用户名主页无法打开的问题;
